webpackJsonp([3322469651764],{1831:function(a,e){a.exports={data:{markdownRemark:{html:"<p>L君带我们去见一位奇人。我们在客厅里坐下他出来了。样子和一般的人没有不同，身材不高。我说是L的朋友，他说那你们就坐吧。他不停地走来走去，客厅里有很多的人。他手里拿着一大把钥匙电话不断。他说L的车怎么的，还没有说出来，就不让他说，告诉我一说车等一会儿就会出事。他的传说听了很久了，就是能够把药片从未开封的瓶子里取出来，能够把嚼碎的名片复原，能够识别信封里的字，能够靠意念搬运东西，等等。很多人均亲眼看到。</p>\n<p>他拿出了两本关于他的书送给我们，签了名，告辞，他来送我们。</p>",id:"/home/swain/workspace/political-life/src/pages/zh/0079.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/zh/0079.md",frontmatter:{title:"4月17日 星期日"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/zh/0079.md absPath of file >>> MarkdownRemark"}}}});
